export const IS_LOCAL = window.location.host === "localhost";

export const baseUrl = () => {
    if (IS_LOCAL) return "http://localhost:3000/api";
};

export const fetcher = (url: string) => fetch(url).then((res) => res.json());

export interface IEmployee {
    id: string;
    name: string;
    surname: string;
    dateOfBirth: string;
    position: string;
    phoneNumber: string;
}
